import React from 'react'
import './Product.css'
const Product = () => {
  const images=[
    "",
    ""
  ];
  return (
 <div className='product'>
  <div className='left'>
    <div className='simages'>
      <img src={images[0]} alt=''/>
      <img src={images[1]} alt=''/>
    </div>
  </div>
  <div className='rigth'></div>
 </div>
  )
}

export default Product
